function Profile() {
    return (
        <div id="info">
            <h1>Juan Aracena</h1>
            <div id="text">
                <h2>Software Developer</h2>
            </div>
            <img id="portrait" src="photo.jpg"></img>
        </div>
    )
}

export default Profile;
